import React, {Component} from 'react';

class Marketplace extends Component {
	constructor(props){
		super(props);
		this.state = {
		lot: []
		}
	}

	componentDidlMount(){
		fetch('/api/lot')
		.then(data => data.json())
		.then(lot => this.setState({lot}));
	}

	render(){
		return(
			<div>
				<h1> Marketplace </h1>
			</div>
		)
	}
}
export default Marketplace;
